import React, { Component } from 'react';
import AppNavbar from './AppNavbar';
import { Link } from 'react-router-dom';
import { Button, Container } from 'reactstrap';
import { alignPropType } from 'react-bootstrap/esm/DropdownMenu';

class Home extends Component {

  constructor(props) {
    super(props);
  }

  componentDidMount() {
  }

  render() {
    return (
      <div>
        <AppNavbar/>
        <Container fluid>
          <div style={{marginTop:"20px"}}>
            
            <div variant="primary" class="alert alert-success" role="alert">
              <h2>Here you will find all the best coupons online at the cheapest prices and the widest variety.</h2>
            </div>
            <Button color="success"><Link to="/signin"><span style={{color:"white"}}>Login</span></Link></Button>
          </div>
        </Container>
      </div>
    );
  }
}
export default Home;
